import { IoIosTimer } from "react-icons/io";

const Head = () => {
  return (
    <>
      <h2 class="heading--2">Recipe ingredients</h2>
      <div style={{ display: "flex" }}>
        <div
          style={{
            display: "flex",
            alignItems: "center",
            paddingRight: "100px",
          }}
        >
          <IoIosTimer
            style={{ fontSize: "20px", color: "#f38e82", paddingRight: "20px" }}
          />{" "}
          75 MINUTE
        </div>
        <div>4 SERVINGS</div>
      </div>
    </>
  );
};

export default Head;
